import React from "react";
import Menu from "./Menu";

export class Page extends React.Component {
    constructor() {
        super();

        this.state = {
            CurrPage:0
        };
    }
    render() {
        return (
                <Menu
                        OnChange={(p)=>{
                            // alert(p);
                            this.setState({CurrPage:p});
                        }}
                        CurrPage={this.state.CurrPage}
                >
                </Menu>

        );
    }
}
